CREATE TABLE IF NOT EXISTS outdoors.climbing(
   RouteName  VARCHAR(49) NOT NULL
  ,Location   VARCHAR(65) NOT NULL
  ,State      VARCHAR(18) NOT NULL
  ,URL        VARCHAR(95) NOT NULL
  ,Avg_Stars  NUMERIC(3,1) NOT NULL
  ,Route_Type VARCHAR(19) NOT NULL
  ,Rating     VARCHAR(13) NOT NULL
  ,Pitches    INTEGER  NOT NULL
  ,Length     INTEGER
);
